import React from "react";
import "./Hero.css";
import Design from "../Desing/Design";

const Hero = () => {
  return (
    <div i>
      {/* <Design /> */}

      <div className="hero">
        <img src="./img/per.png" alt="" />
        <h1>
          <span>I'm Adib Kazi,</span> frontend developer based in Pune
        </h1>
        <p>
          I am a frontend developer from Pune, Maharashtra with 1 year of
          experience.
        </p>
        <div className="hero-action">
          <a
            href="/contact"
            className="hero-connect"
            style={{ color: "white", textDecoration: "none" }}
          >
            Connect With Me
          </a>
          <a
            href="/resume"
            className="hero-resume"
            style={{ color: "white", textDecoration: "none" }}
          >
            My resume
          </a>
        </div>
      </div>
    </div>
  );
};

export default Hero;
